import Home from './pages/Home';
import Directors from './pages/Directors';
import Actors from './pages/Actors';
import Movie from './pages/Movie';
import ErrorPage from './pages/ErrorPage';
const routes = [
  {
    path: '/',
    element: <Home />,
    error: <ErrorPage />,
  },
  {
    path: '/directors',
    element: <Directors />,
    error: <ErrorPage />,
  },
  {
    path: '/actors',
    element: <Actors />,
    error: <ErrorPage />,
  },
  {
    path: '/movie/:id',
    element: <Movie />,
    error: <ErrorPage />,
  },
];

export default routes;
